import logo from './logo.svg';
import './App.css';
import React from 'react';

export default class App extends React.Component {
  constructor(props){
    super(props);
     this.state={msg:''}
    }

    callAPI(){
       fetch("http://localhost:9000/testAPI")
       .then(res => res.text())
       .then(res => this.setState({api:res}))
    }

    componentWillMount(){
      this.callAPI();
    }

render(){
   return (
    <div className="App">
      <div>{this.state.api}</div>
    <input type="text" placeholder='type something' value={this.state.msg} onChange={(e)=>{this.setState({msg:e.target.value})}}/>
    <button ></button>
    </div>
  );
}

}
